column8:
新素材「エアロキューブ(TM)」を採用したエアリーマットレスです。<br />
「エアロキューブ(TM)」は、三次元スプリング構造により従来のマットレスに比べてクッション性、体圧分散性、通気性、耐久性に優れた、丸洗い可能な素材です。<br />
適度な反発力で寝返りをサポートします。<br />
また体圧分散性で腰や背中の負担を軽減するため、正しい寝姿勢を維持し快眠をサポートします。<br />
繊維の隙間から湿気を外へ逃がすため、寝汗がマットレスにこもりにくくなっています。<br />
三つ折りにして立てかけることでき、お手入れ簡単。<br />
約8万回の圧縮テストで硬度保持率85％！<br />
耐久性に優れており、毎日お使いいただいてもへたりにくい構造です。<br />
お洗濯することが可能なので、いつでも清潔にお使いいただけます。<br /><br />
